    let temp1 = "http://localhost:8000/match/"
    let temp2 = "1"
    let temp3 = "/summary"
    let link = temp1 + temp2 + temp3
    // console.log(link)
    const [data, setData] = useState([]);

    const fetchData = () => {
        return fetch("http://localhost:8000/match/1/summary")
            .then((response) => response.json())
            .then((data) => setData(data));
    }

    useEffect(() => {
        fetchData();
    },[])

